import React from 'react';
import './gameList.css';
import {useState, useEffect} from 'react';
import { useNavigate} from 'react-router-dom';


export default function GameList(){
    const titleName = "게임 리스트";
    const htmlTitle = document.querySelector("title");
    htmlTitle.innerHTML = titleName;

    const [gameList, setGameList] = useState([]);

    useEffect(() =>{
        fetch(
            "http://localhost:80/gameList",{
                method : "GET"
            }
        )
        .then(res => res.json())
        .then(res =>{
            setGameList(res);
        })},[])


    return(
    <>
    <div className='table_title_div'>
        <h3>게임 목록</h3>
    </div>	
    <table className='table_div'>
        <thead>
            <tr>
                <th className='text-left th_title'>제목</th>
                <th className='text-left th_reader'>방장</th>
                <th className='text-left th_amount'>인원</th>
                <th className='text-left th_pass'>&#128274;</th>
            </tr>
        </thead>
        <tbody className='table-hover'>
            <tr className='gameList_tr'>
                <td className='text-left'>zxc</td>
                <td className='text-left'>asd</td>
                <td className='text-left'>123</td>
            </tr>
        </tbody>
    </table>
    </>
    );
}
